(1, 1, 'Afghanistan', 'Afghanistan, officially the Islamic Republic of Afghanistan, is a landlocked country at the crossroads of Central and South Asia. Afghanistan is bordered by Pakistan to the east and south; Iran to the west; Turkmenistan, Uzbekistan, and Tajikistan to the north; and China to the northeast. Wikipedia', 'Abdul Saboor', '2020-08-16 04:28:34', );
