(4, 3, 'Do you need java ?', 'Java is a programming language and computing platform first released by Sun Microsystems in 1995. There are lots of applications and websites that will not work unless you have Java installed, and more are created every day. Java is fast, secure, and reliable. From laptops to datacenters, game consoles to scientific supercomputers, cell phones to the Internet, Java is everywhere!   Alkisah, seorang pejabat tinggi Belanda datang ke istana Yogyakarta membawa seekor harimau putih besar sebagai hadiah bagi Sultan. Ia mendengar bahwa Sultan sangat menggemari adu harimau dan kerbau. Abdi keraton pun segera sibuk mempersiapkan arena untuk laga antara harimau dan kerbau itu.\r\n\r\nDalam laga yang disaksikan seluruh penghuni keraton itu, kerbau milik Sultan berhasil mengalahkan harimau. Sultan sangat girang atas kemenangan kerbaunya. Begitu pula si pejabat Belanda. Ia mengira bahwa dengan taktik diplomasi ini bisa memperlancar urusannya dengan Sultan.\r\n\r\nTetapi si pejabat Belanda itu salah kira. Sejak lama orang Jawa biasa merepresentasikan dirinya sebagai kerbau dan orang Belanda sebagai harimau. Maka kemenangan kerbau milik Sultan adalah suatu pertanda kemujuran. Sebaliknya, jika Belanda punya harimau yang tak terkalahkan, itu berarti buruk bagi para bangsawan Jawa.\r\n\r\nSejarawan Bernard H.M. Vlekke mendapatkan kisah itu dari magnum opus Sir Thomas Stamford Raffles, The History of Java (selanjutnya disebut HJ). Vlekke mengutip kisah itu dalam Nusantara: Sejarah Indonesia (2016: 251) untuk menunjukkan bagaimana orang Belanda masih asing dengan alam pikir orang Jawa meskipun telah saling berinteraksi sejak abad ke-17.  Kekalahan harimau bagi orang Jawa adalah sebentuk ejekan tak terucap kepada orang Belanda. Tapi menurut Tim Hannigan dalam Raffles dan Invasi Inggris ke Jawa (2015), Belanda sama sekali tak menyadari simbolisme ini.\r\n\r\n“Bergenerasi-generasi pejabat Belanda yang berpakaian hitam bertepuk tangan dengan puas dari panggung penonton ketika harimau dilemparkan kerbau ke udara dengan luka tusuk tanduk yang fatal di perutnya, sama sekali tidak tahu alasan mengapa orang Jawa di sekitar mereka tersenyum begitu lebar,” tulis Hannigan (hlm. 299).\r\n\r\nBarangkali orang Belanda baru menyadarinya setelah History of Java terbit pertama kali pada 1817. HJ adalah publikasi pertama yang memberikan informasi tentang Jawa dan penduduknya secara lengkap. Vlekke menilai karya Raffles itu jauh dari netral tetapi isinya menarik dan ditulis secara brilian.Java is a programming language and computing platform first released by Sun Microsystems in 1995. There are lots of applications and websites that will not work unless you have Java installed, and more are created every day. Java is fast, secure, and reliable. From laptops to datacenters, game consoles to scientific supercomputers, cell phones to the Internet, Java is everywhere!   Alkisah, seorang pejabat tinggi Belanda datang ke istana Yogyakarta membawa seekor harimau putih besar sebagai hadiah bagi Sultan. Ia mendengar bahwa Sultan sangat menggemari adu harimau dan kerbau. Abdi keraton pun segera sibuk mempersiapkan arena untuk laga antara harimau dan kerbau itu.\r\n\r\nDalam laga yang disaksikan seluruh penghuni keraton itu, kerbau milik Sultan berhasil mengalahkan harimau. Sultan sangat girang atas kemenangan kerbaunya. Begitu pula si pejabat Belanda. Ia mengira bahwa dengan taktik diplomasi ini bisa memperlancar urusannya dengan Sultan.\r\n\r\nTetapi si pejabat Belanda itu salah kira. Sejak lama orang Jawa biasa merepresentasikan dirinya sebagai kerbau dan orang Belanda sebagai harimau. Maka kemenangan kerbau milik Sultan adalah suatu pertanda kemujuran. Sebaliknya, jika Belanda punya harimau yang tak terkalahkan, itu berarti buruk bagi para bangsawan Jawa.\r\n\r\nSejarawan Bernard H.M. Vlekke mendapatkan kisah itu dari magnum opus Sir Thomas Stamford Raffles, The History of Java (selanjutnya disebut HJ). Vlekke mengutip kisah itu dalam Nusantar