INSERT INTO `post` (`post_id`, `category_id`, `title`, `body`, `author`, `post_date`, `images`) VALUES
(5, 5, 'What is Coronavirus ?', 'Coronaviruses are a group of related RNA viruses that cause diseases in mammals and birds. In humans and birds, they cause respiratory tract infections that can range from mild to lethal. Mild illnesses in humans include some cases of the common cold (which is also caused by other viruses, predominantly rhinoviruses), while more lethal varieties can cause SARS, MERS, and COVID-19. In cows and pigs they cause diarrhea, while in mice they cause hepatitis and encephalomyelitis. There are as yet no vaccines or antiviral drugs to prevent or treat human coronavirus infections.', 'Google', '2020-08-16 14:03:27', );
