(8, 1, 'Afghanistan is beautiful', 'When we think of Afghanistan – if, indeed, we do – it is through a lens fractured by war. That’s not surprising. For much of the last two millennia the land that we now call Afghanistan has been embroiled in some sort of conflict, whether fighting off outside invaders – Persians, Arabs, Mughals, Sikhs, Russians, Brits – or with itself, hardy tribes clashing on battlefields already stained with the blood of their ancestors', NULL, '2020-08-20 07:26:53', NULL);

